import React,{Component} from 'react'

class Navbar extends Component {
    render(){
        return(
            <nav className="nav-wrapper">
                <div className="container">
            <h4 className="brand-logo">Context App</h4>
            <ul className="right">
                <li>Home</li> 
                <li>About</li> 
                <li>Contact</li> 

            </ul>
            </div>
            </nav>
        )
    }
}
export default Navbar
